import React, { Component } from 'react';

class Footer extends Component {

    render() { 

        var footerStyle = {
            textAlign: 'center',
            backgroundColor: '#d1d1d1',
            position: 'fixed',
            bottom: 'offset'
          }

        return (<footer className="App-footer" style={footerStyle}><h1><p>menu options</p></h1></footer>);
    }
}
 
export default Footer;
